import React, { Component } from 'react'
import { get } from '../../../../../utils/'
import Tr from './ShowList/Tr'
import './index.css'

export default class ShowList extends Component {
    state={
        arr:[]
    }
    getall = async()=>{
        try{
            let res = await get('/api/getall')
            this.setState({arr:res.data.data})
        }catch(err){
            console.log("error",err)
     }
    }
    componentDidMount(){
        this.getall()
    }
    render() {
        return (
            <div id="table">
                    <tr>
                        <td><input type="checkbox" /></td>
                        <td>编号</td>
                        <td>日期</td>
                        <td>失物</td>
                        <td>姓名</td>
                        <td>学号</td>
                        <td>状态</td>
                        <td>领取地址</td>
                        <td>操作</td>
                    </tr>
                    {this.state.arr.map((item,index)=>{
                        return <Tr {...item}></Tr>
                    })}
            </div>
        )
    }
}
